import axios from 'axios';

/*
ActionCreators -> create/return Actions ({ }) -> dispatched -> middlewares -> reducers
*/

export const signUp = data => {
    /*
        Step 1) Use the data and to make HTTP request to our BE abd send it along
        Step 2) Take BE response (jwtToken is hee now!)
        Step 3) Dispatch user just signed up (with jwtToken)
        Step 4) Save the jwtToken into our localStorage
    */

    return async dispatch => {
        try {
          const res = await axios.post('http://localhost:5001/users/signup', data);
          console.log('res', res);
        } catch (error) {
            console.log('err', error);
        }


    }
}
